import React, { useEffect , useState} from 'react'
import { TextField, Button} from '@material-ui/core'
import {Form, FormGroup} from "reactstrap";
import { makeStyles } from '@material-ui/core'
import axios from 'axios'
import 'bootstrap/dist/css/bootstrap.min.css';
import HeaderforAdminPage from "../headers/HeaderforAdminpage";
import Axios from "axios";

const useStyles = makeStyles(()=>({
    TextField : {
        margin : 20
    },
    buttonSignin : {
        marginTop : 30,
            marginLeft :70
    },
    buttonSignup :{
        marginTop :30,
            marginLeft :110
    },
    form :{
        alignContent : "center"
    },
    Button :{
        margin:30
    },
    boxBorder :{
        border : "gray 5px solid",
        marginTop:10
    },
}));

const MaterialAddPage = ()=>{

    //const baseUrl = "http://localhost:8080";



    const classes = useStyles();
    const url = "http://localhost:8080/material/add"

    const[data, setData] = useState({

        category:"", productCompany:"", productCountry:"",
        itemName:"", itemTagNum:"", standard:"",
        noOfItem:"",  cost:"", minSellingPrice:"", purchaserId:""

    })
    function handleFields(e){
        const newData = {...data}
        newData[e.target.id] =e.target.value;
        setData(newData);
        console.log(newData)
    }
    function handleSubmit(e){
        e.preventDefault();
        alert("called")
        Axios.post(url,{
            category:data.category,
            productCompany:data.productCompany,
            productCountry:data.productCountry,
            itemName:data.itemName,
            itemTagNum:data.itemTagNum,
            standard:data.standard,
            noOfItem:data.noOfItem,
            purchaserId:data.purchaserId,
            cost:data.cost,
            minSellingPrice:data.minSellingPrice,

        }).then(res=>{
            alert("material with tag number: "+res.data.itemTagNum + " is successfully added")
        }).catch(err=>{
            alert("Error while adding material: " +err)

        })
    }
    return(
        <>
            <HeaderforAdminPage/>
<div className={classes.boxBorder}>
            <Form>
                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Category"}
                    placeholder = {"Agriculture"}
                    variant = {"outlined"}
                    value = {category}
                    onChange = {(event)=>{
                        setCategory(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Country Made Of"}
                    placeholder = {"product country"}
                    variant = {"outlined"}
                    value = {productCountry}
                    onChange = {(event)=>{
                        setProductCountry(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Product Company"}
                    placeholder = {"JohnDeere"}
                    variant = {"outlined"}
                    value = {productCompany}
                    onChange = {(event)=>{
                        setProductCompany(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Product Name"}
                    placeholder = {"Tractor"}
                    variant = {"outlined"}
                    value = {itemName}
                    onChange = {(event)=>{
                        setItemName(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Product Tag Number"}
                    placeholder = {"0012/20"}
                    variant = {"outlined"}
                    value = {itemTagNum}
                    onChange = {(event)=>{
                        setItemTagNum(event.target.value);
                    }}
                />
                <TextField
                    type = {"text"}
                    autoFocus = {true}
                    label={"Standard"}
                    className = {classes.TextField}
                    variant = {"outlined"}
                    value = {standard}
                    onChange = {(event)=>{
                        setStandard(event.target.value);
                    }}
                />

                <TextField
                    type = {"number"}
                    autoFocus = {true}
                    label={"Number Of Items"}
                    className = {classes.TextField}
                    variant = {"outlined"}
                    value = {noOfItem}
                    onChange = {(event)=>{
                        setNoOfItem(event.target.value);
                    }}
                />
                <TextField
                    type = {"number"}
                    autoFocus = {true}
                    label={"Cost"}
                    className = {classes.TextField}
                    variant = {"outlined"}
                    value = {cost}
                    onChange = {(event)=>{
                        setCost(event.target.value);
                    }}
                />
                <TextField
                    type = {"number"}
                    autoFocus = {true}
                    label={"Minimum Selling Price"}
                    className = {classes.TextField}
                    variant = {"outlined"}
                    value = {minSellingPrice}
                    onChange = {(event)=>{
                        setMinSellingPrice(event.target.value);
                    }}
                />

                <TextField
                    type = {"number"}
                    autoFocus = {true}
                    className = {classes.TextField}
                    label = {"Purchaser Employee Company Id"}
                    placeholder = {"employee company id"}
                    variant = {"outlined"}
                    value = {purchaserId}
                    onChange = {(event)=>{
                        setPurchaserId(event.target.value);
                    }}
                />

                <Button
                    className = {classes.Button}
                    variant = {"contained"}
                    color = {"primary"}
                    onClick = {()=> setIsSubmitClicked(true)}
                >
                    save product
                </Button>

            </Form>
</div>
        </>
    )
}

export default MaterialAddPage
